import React, { Component } from 'react'

import { Button, Modal, ModalHeader, ModalBody, ModalFooter } from 'reactstrap';
import Sign from './Member/Sign'
import Register from './Member/Register'


export default class AppNav extends Component {

  constructor(props) {
    super(props);
    this.state = {
      modal: false
    };

    this.toggle = this.toggle.bind(this);
  }

  toggle() {
    this.setState(prevState => ({
      modal: !prevState.modal
    }));
  }

  render() {
    return (
      <div>
      <Button color="danger" onClick={this.toggle}>{this.props.buttonLabel} Sign</Button>
      <Modal isOpen={this.state.modal} toggle={this.toggle} className={this.props.className}>
        <ModalHeader toggle={this.toggle}>Sign In</ModalHeader>
        <ModalBody>
          <Sign />
        </ModalBody>
        <ModalFooter>
          <Button color="primary" onClick={this.toggle}>Do Something</Button>{' '}
          <Button color="secondary" onClick={this.toggle}>Cancel</Button>
        </ModalFooter>
      </Modal>
      <Button color="danger" onClick={this.toggle}>{this.props.buttonLabel} Register</Button>

      <Modal  isOpen={this.state.modal} toggle={this.toggle} 
      className={this.props.className}>
        <ModalHeader style={{
  width: '650px',
  backgroundColor: '#ffffff'

         }} toggle={this.toggle}>Register</ModalHeader>
        <ModalBody>
          <Register />
        </ModalBody>
        <ModalFooter>
         <h4>Already have an account ?</h4> <h4>Login</h4>
        </ModalFooter>
      </Modal>
    </div>
    )
  }
}
